`,paraId:5,tocIndex:0},{value:"\u4E00\u822C\u5728\u7EC4\u4EF6\u7684\u6839\u8282\u70B9\u4E0A\uFF0C\u6211\u4EEC\u4F1A\u6839\u636E ",paraId:6,tocIndex:2},{value:"props",paraId:6,tocIndex:2},{value:" \u548C ",paraId:6,tocIndex:2},{value:"state",paraId:6,tocIndex:2},{value:" \u521B\u5EFA\u4E00\u4E2A Context \u6765\u5C06\u805A\u5408\u6570\u636E\u4F20\u9012\u4E0B\u53BB\u3002\u4F46\u662F\u5728\u67D0\u4E9B\u60C5\u51B5\u4E0B\u53EF\u80FD Context \u5B9E\u9645\u5185\u5BB9\u6CA1\u6709\u53D8\u5316\u4E5F\u89E6\u53D1\u5B50\u7EC4\u4EF6\u7684\u91CD\u65B0\u6E32\u67D3\uFF1A",paraId:6,tocIndex:2},{value:`// pseudocode
